import React from 'react'
import project from '../../components/section/projects/timeline/project'

const AllProjects = () => {
  return (
    <div>
    {project.map(element => {
        <div>
            return(
                <h1>{element.title}</h1>
            )
        </div>
      })}
    </div>

  )
}

export default AllProjects
